import React from  "react";
import '../../styles/imports.scss';


const UserPanel = ()=>{
	return(
		<div className="userPanel flex">
			<img src={require("../../public/assets/home_icoon.svg")}  alt="user"/>
			<p>settings en stuff</p>
		</div>
	)
}

export default UserPanel;
